import React, { Suspense, lazy, Fragment } from 'react';
import { Switch, Route } from 'react-router-dom';
import PrivateRoute from './PrivateRoute';
import HighOrderLayout from '../containers/HighOrderLayout';
import Loader from '../components/commons/Loader';
import Login from '../containers/Login';
import Dashboard from '../containers/Dashboard';
import Tracking from '../containers/Tracking';
import Reports from '../containers/Reports';
import Configurations from '../containers/Configurations';

function Routers() {
  return (
    <Switch>
      <Suspense fallback={<Loader />}>
        <Route exact path='/login' component={Login} />
        <PrivateRoute
          exact
          path='/'
          render={() => <Fragment>{HighOrderLayout(Dashboard)}</Fragment>}
        />
        <PrivateRoute
          exact
          path='/operations'
          render={() => HighOrderLayout(Dashboard)}
        />
        <PrivateRoute
          exact
          path='/tracking'
          render={() => HighOrderLayout(Tracking)}
        />
        <PrivateRoute
          exact
          path='/reports'
          render={() => HighOrderLayout(Reports)}
        />
        <PrivateRoute
          exact
          path='/configurations'
          render={() => HighOrderLayout(Configurations)}
        />
      </Suspense>
    </Switch>
  );
}

export default Routers;
